import React, {useState} from 'react';

import Header from './Header';

function App() {
  let counter = useState(0);

  function Add(){
    counter ++;
    console.log(counter);
  }
  return (
    <div>
      <Header>Contador: {counter}</Header>
      <button onClick={Add}>Adicionar</button>
    </div>
  );
}

export default App;
